using ObjectiveC;using System;using SwiftSharp.Attributes;namespace Foundation{    //added find/remove/domain/service prefixes    //https://developer.apple.com/library/prerelease/ios/documentation/Cocoa/Reference/NSNetServiceBrowserDelegate_Protocol/index.html#//apple_ref/occ/intf/NSNetServiceBrowserDelegate    /// <summary>    /// The NSNetServiceBrowserDelegate protocol defines the optional methods implemented by delegates of NSNetServiceBrowser objects.    /// </summary>    [iOSVersion(4)]    public interface NSNetServiceBrowserDelegate    {        /// <summary>        /// Tells the delegate the sender found a domain.        /// </summary>        /// <param name="netServiceBrowser">Sender of this delegate message.</param>        /// <param name="didFindDomain">Name of the domain found by netServiceBrowser.</param>        /// <param name="moreComing">true when netServiceBrowser is waiting for additional domains. false when there are no additional domains.</param>        [iOSVersion(2)]        [Export("netServiceBrowser")]        [Optional]        void FindDomainNetServiceBrowser(NSNetServiceBrowser netServiceBrowser, string didFindDomain, bool moreComing);                /// <summary>        /// Tells the delegate the a domain has disappeared or has become unavailable.        /// </summary>        /// <param name="netServiceBrowser">Sender of this delegate message.</param>        /// <param name="didRemoveDomain">Name of the domain that became unavailable.</param>        /// <param name="moreComing">true when netServiceBrowser is waiting for additional domains. false when there are no additional domains.</param>        [iOSVersion(2)]        [Export("netServiceBrowser")]        [Optional]        void RemoveDomainNetServiceBrowser(NSNetServiceBrowser netServiceBrowser, string didRemoveDomain, bool moreComing);                /// <summary>        /// Tells the delegate the sender found a service.        /// </summary>        /// <param name="netServiceBrowser">Sender of this delegate message.</param>        /// <param name="didFindService">Network service found by netServiceBrowser. The delegate can use this object to connect to and use the service.</param>        /// <param name="moreComing">true when netServiceBrowser is waiting for additional services. false when there are no additional services.</param>        [iOSVersion(2)]        [Export("netServiceBrowser")]        [Optional]        void FindServiceNetServiceBrowser(NSNetServiceBrowser netServiceBrowser, NSNetService didFindService, bool moreComing);                /// <summary>        /// Tells the delegate a service has disappeared or has become unavailable.        /// </summary>        /// <param name="netServiceBrowser">Sender of this delegate message.</param>        /// <param name="didRemoveService">Network service that has become unavailable.</param>        /// <param name="moreComing">true when netServiceBrowser is waiting for additional services. false when there are no additional services.</param>        [iOSVersion(2)]        [Export("netServiceBrowser")]        [Optional]        void RemoveServiceNetServiceBrowser(NSNetServiceBrowser netServiceBrowser, NSNetService didRemoveService, bool moreComing);                /// <summary>        /// Tells the delegate that a search is commencing.        /// </summary>        /// <param name="netServiceBrowser">Sender of this delegate message.</param>        [iOSVersion(2)]        [Export("netServiceBrowserWillSearch")]        [Optional]        void NetServiceBrowserWillSearch(NSNetServiceBrowser netServiceBrowser);                /// <summary>        /// Tells the delegate that a search was not successful.        /// </summary>        /// <param name="netServiceBrowser">Sender of this delegate message.</param>        /// <param name="didNotSearch">Dictionary with the reasons the search was unsuccessful. Use the dictionary keys NSNetServicesErrorCode and NSNetServicesErrorDomain to retrieve the error information from the dictionary.</param>        [iOSVersion(2)]        [Export("netServiceBrowser")]        [Optional]        void NetServiceBrowser(NSNetServiceBrowser netServiceBrowser, NSDictionary didNotSearch);                /// <summary>        /// Tells the delegate that a search was stopped.        /// </summary>        /// <param name="netServiceBrowser">Sender of this delegate message.</param>        [iOSVersion(2)]        [Export("netServiceBrowserDidStopSearch")]        [Optional]        void NetServiceBrowserDidStopSearch(NSNetServiceBrowser netServiceBrowser);    }}